import React from "react";

const LogoSvg = props => (
  <svg
    width={372}
    height={372}
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <defs>
      <circle id="a" cx={186} cy={186} r={186} />
    </defs>
    <g fill="none" fillRule="evenodd">
      <mask id="b" fill="#fff">
        <use xlinkHref="#a" />
      </mask>
      <use fillOpacity={0} fill="#D8D8D8" xlinkHref="#a" />
      <circle
        stroke="#288237"
        strokeWidth={8}
        fill="none"
        mask="url(#b)"
        cx={186}
        cy={186}
        r={182}
      />
      <path
        stroke="#288237"
        strokeWidth={8}
        fill="#288237"
        mask="url(#b)"
        d="M78.457 340.066l279.594-236.472 43.176 96.586 28.23 126.258-130.275 119.55-220.725-13.042z"
      />
      <path
        stroke="#288237"
        strokeWidth={8}
        d="M123 164.46L184.742 80l80.809 98.793M5.156 211.43l91.57-74.485 97.55 103.47"
      />
    </g>
  </svg>
);

export default LogoSvg;
